import React from 'react'
import { CFooter } from '@coreui/react'

const TheFooter = () => {
  return (
    <CFooter fixed={false}>
      <div>
        <a href="https://coreui.io" target="_blank" rel="noopener noreferrer">News Portal Dashboard</a>
        <span className="ml-1">&copy; 2020.</span>
      </div>

    </CFooter>
  )
}

export default React.memo(TheFooter)
